static void cb_elabora_btn_compra_marm(Fl_Button*, void*) {
  if(CompraUnPezzo(MARMITTA, elabora_menu_marm->value())) {
  AggiornaScooter();
  RiempiCampi();
  elabora_menu_marm->do_callback();
  win_elabora->redraw();
  }
else {
  win_scooter->activate();
  win_elabora->hide();
};
}

